import React, { Component, Fragment } from 'react';
import { Link } from "react-router-dom";
import './style.css';
import './css/bootstrap.min.css';
import './css/style.css';
import './css/responsive.css';
import './css/orange.css';
import client1 from './images/client-1.jpg';
import client2 from './images/client-2.jpg';
import client3 from './images/client-3.jpg';
import landingslider1 from './images/landing-slider-1.jpg';
import Registration from './Registration';

class Home extends Component {

	constructor(props) {
		super(props);
    console.log("=====into====");
    console.log(this.props.location.state);
    this.goProfile = this.goProfile.bind(this);
	}

  goProfile(){
    console.log("=====goProfile====");
    console.log(this.props.location.state);
    console.log("=====user name====");
    var username = this.props.location.state;

    this.props.history.push({pathname:'/profile', state:{name: 'testtest'}});
    console.log(username);
    console.log("=====end goProfile====");
  }

  replaceLogin() {
    console.log("=====replaceLogin====");
    console.log(this.props.location.state);
    if(this.props.location.state && this.props.location.state !== '') {
      return(
        <ul className="list-unstyled list-inline">
            <li><Link to={{pathname:'/profile/', state:this.props.location.state}} ><span><i className="fa fa-lock" /></span>My Profile</Link></li>
            <li><Link to="/Home " ><span><i className="fa fa-lock" /></span>Sign Out</Link></li>
          </ul> 

        );
      } else {
        return(
        <ul className="list-unstyled list-inline">
          <li><Link to="/login" ><span><i className="fa fa-lock" /></span>Login</Link></li>
          <li><Link to="/registration" ><span><i className="fa fa-plus" /></span>Sign Up</Link></li>
        </ul> 
        );
      }
  }

render() {
	return(
<div>

        {/*============= TOP-BAR ===========*/}
        <div id="top-bar" className="tb-text-white">
          <div className="container">
            <div className="row">          
              <div className="col-xs-12 col-sm-6 col-md-6 col-lg-6">
                <div id="info">
                  <ul className="list-unstyled list-inline">
                    <li><span></span></li>
                    <li><span></span></li>
                  </ul>
                </div>{/* end info */}
              </div>{/* end columns */}
              <div className="col-xs-12 col-sm-6 col-md-6 col-lg-6">
                <div id="links">
                  {this.replaceLogin()}
                </div>{/* end links */}
              </div>{/* end columns */}       
            </div>{/* end row */}
          </div>{/* end container */}
        </div>{/* end top-bar */}
        <nav className="navbar navbar-default main-navbar navbar-custom navbar-white" id="mynavbar-1">
          <div className="container">
            <div className="navbar-header">
              <button type="button" className="navbar-toggle" id="menu-button">
                <span className="icon-bar" />
                <span className="icon-bar" />
                <span className="icon-bar" />                        
              </button>

              <a href="#" className="navbar-brand"><span><i className="fa fa-plane" />SJ</span>SU</a>
            </div>{/* end navbar-header */}
            <div className="collapse navbar-collapse" id="myNavbar1">
              <ul className="nav navbar-nav navbar-right navbar-search-link">
                <li className="dropdown active"><a href="#" className="dropdown-toggle" data-toggle="dropdown">Home<span></span></a>  
                </li>
                <li className="dropdown"><Link to='/flighthome' className="dropdown-toggle">Flights<span></span></Link>
                </li>

                <li></li>
              </ul>
            </div>{/* end navbar collapse */}
          </div>{/* end container */}
        </nav>{/* end navbar */}        

        {/*======================= BEST FEATURES =====================*/}
      <section id="best-features" className="banner-padding black-features">
        <div className="container">
          <div className="row">
            <div className="col-sm-6 col-md-3">
              <div className="b-feature-block">
                <span><i className="fa fa-dollar" /></span>
                <h3>Best Price Guarantee</h3>
                <p>Lorem ipsum dolor sit amet, ad duo fugit aeque fabulas, in lucilius prodesset pri. Veniam delectus ei vis.</p>
              </div>{/* end b-feature-block */}
            </div>{/* end columns */}
            <div className="col-sm-6 col-md-3">
              <div className="b-feature-block">
                <span><i className="fa fa-lock" /></span>
                <h3>Safe and Secure</h3>
                <p>Lorem ipsum dolor sit amet, ad duo fugit aeque fabulas, in lucilius prodesset pri. Veniam delectus ei vis.</p>
              </div>{/* end b-feature-block */}
            </div>{/* end columns */}
            <div className="col-sm-6 col-md-3">
              <div className="b-feature-block">
                <span><i className="fa fa-thumbs-up" /></span>
                <h3>Best Travel Agents</h3>
                <p>Lorem ipsum dolor sit amet, ad duo fugit aeque fabulas, in lucilius prodesset pri. Veniam delectus ei vis.</p>
              </div>{/* end b-feature-block */}
            </div>{/* end columns */}
            <div className="col-sm-6 col-md-3">
              <div className="b-feature-block">
                <span><i className="fa fa-bars" /></span>
                <h3>Travel Guidelines</h3>
                <p>Lorem ipsum dolor sit amet, ad duo fugit aeque fabulas, in lucilius prodesset pri. Veniam delectus ei vis.</p>
              </div>{/* end b-feature-block */}
            </div>{/* end columns */}
          </div>{/* end row */}
        </div>{/* end container */}
      </section>{/* end best-features */}
      </div>
				)
}

}

export default Home;
